export default class MethodRecommendations extends Component {
  
  componentDidMount() {
    document.title = "Методические рекомендации";
  }
  render() {

    return (
      
        <BasePageWithCard isAuthenticated={true} >
            <MethodRecommendationsCard/>
        </BasePageWithCard>
    )
  }
}
